import {makeStyles} from "@material-ui/core/styles";

export const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        overflow: 'hidden',
        position: 'relative',
        fontSize: '1.25rem',
        alignItems: 'center',
        flexShrink: 0,
        fontFamily: 'Roboto Helvetica Arial sans-serif',
        lineHeight: 1,
        userSelect: 'none',
        borderRadius: '50%',
        justifyContent: 'center',
    },
    appBar: {
        zIndex: theme.zIndex.drawer + 1,
    },
    spacer: {
        flexGrow: 1,
    },
}));
